import './itemcard.css';

const item = (param) => {
    return(
        <>
            <div id="card" className={param.flip}>
                <img src = {param.src} id="profile_photo"></img>
                
                <div id="explanation">
                    <h1 id="title">{param.title}</h1>
                    <div id="desc">{param.desc}</div>
                </div>
                
            </div>
        </>
    )
};

export default item
